const Login=()=>{
    return (
        <div className="container">
            <div className="valign-wrapper card-panel">
                <div class="input-field col s6">
                    <input placeholder="Email" id="email" type="text" />
                    <label for="email">Email</label>
                </div>
            </div>
        </div>
    );
}
export default Login;
